query BidFlowBidResultScreenRendererQuery(
  $saleArtworkID: String!
) {
  sale_artwork(id: $saleArtworkID) {
    ...BidResult_sale_artwork
    __id
  }
}

fragment BidResult_sale_artwork on SaleArtwork {
  minimum_next_bid {
    amount
    cents
    display
  }
  sale {
    live_start_at
    end_at
    __id
  }
  increments {
    display
    cents
  }
  __id
}
